$(document).ready(function() {
  var editableOptions = {
    success: function(response, newValue) {
      $(this).html(newValue);
      updatePreview();
    }
  };

  $('.template-block-title').editable(editableOptions);

  var token = $('meta[name="csrf-token"]').attr('content');
  var createNewColumn = function(grid) {
    var block = Mustache.to_html($("#TemplateNewBlockTemplate").html()),
      column = Mustache.to_html($("#TemplateColumnTemplate").html(), {grid:grid, block:block});
    return column;
  }

  var createNewRow = function(grid) {
    var column = createNewColumn(grid),
      row = Mustache.to_html($("#TemplateRowTemplate").html(), {column:column});
    return row;
  }

  $(document).on('click', '.template-addColumn', function() {
    var column = createNewColumn(2);
    $(this).closest('.template-editing').children(".template-tools").last().before(column);
    $('.template-block-title').editable(editableOptions);
    updatePreview();
  });

  $(document).on('click', '.template-addRow', function() {
    var row = createNewRow(12),
      prevElement = $(this).parent().prev();
    if (prevElement.hasClass('template-editable-region')) {
      prevElement.replaceWith(row);
    }else{
      prevElement.after(row);
    }
    $('.template-block-title').editable(editableOptions);
    updatePreview();
  });

  $(document).on('click', '.template-addNewRow', function() {
    var row = createNewRow(12);
    $('#template-canvas').prepend(row);
    $('.template-block-title').editable(editableOptions);
    updatePreview();
  });

  var fixRemovedRow = function(column) {
    if (column.length) {
      var subRows = column.children('.row.template-editing');
      if (subRows.length <= 1) {
        var block = Mustache.to_html($("#TemplateNewBlockTemplate").html());
        column.children(".template-tools").last().before(block);
        $('.template-block-title').editable(editableOptions);
      }
    }
  }

  $(document).on('click', '.template-removeRow', function() {
    var row = $(this).closest('.row.template-editing'),
      column = row.closest('.column.template-editing');

    fixRemovedRow(column);
    row.remove();
    updatePreview();
  });

  $(document).on('click', '.template-removeCol', function() {
    $(this).closest('.column.template-editing').remove();
    updatePreview();
  });

  var resize = function(element, type) {
    var grid = parseInt(element.data('template-grid')),
      old = grid;
    grid = type == 'minus' && grid > 1 ? grid - 1: grid;
    grid = type == 'plus' && grid < 12 ? grid + 1: grid;
    element.data('template-grid', grid);
    element.removeClass('col-md-' + old).addClass('col-md-' + grid);
  }

  $(document).on('click', '.template-colIncrease', function() {
    var column = $(this).closest('.template-editing');
    resize(column, 'plus');
    updatePreview();
  });

  $(document).on('click', '.template-colDecrease', function() {
    var column = $(this).closest('.template-editing');
    resize(column, 'minus');
    updatePreview();
  });

  $('#template-title').on('input', function() {
    updatePreview();
  });

  var sortColumnItem;
  $( "#template-canvas" ).sortable({
    items: ".row.template-editing",
    placeholder: "alert-warning",
    forcePlaceholderSize: true,   opacity: 0.7,  revert: true,
    tolerance: "pointer",
    cursor: "move",
    handle: ".template-moveRow",
    start: function(e, ui) {
      var row = ui.item.closest('.row.template-editing');
      sortColumnItem = row.closest('.column.template-editing');
      console.log("start", sortColumnItem);
    },
    stop: function(e, ui) {
      console.log("stop", sortColumnItem);
      fixRemovedRow(sortColumnItem);
      updatePreview();
    }
  });

  $( ".row.template-editing" ).sortable({
    items: ".column.template-editing",
    placeholder: "alert-warning",
    forcePlaceholderSize: true,   opacity: 0.7,  revert: true,
    tolerance: "pointer",
    cursor: "move",
    handle: ".template-moveCol",
    stop: function(e, ui) {
      updatePreview();
    }
  });

  /* Generate */
  var generate = {
    _json: {},
    _html: '',
    _identifier: '',
    _elementId: 'template-canvas',
    rand: function() {
      var time = new Date().getTime(),
        n=Math.floor(Math.random()*11),
        k = Math.floor(Math.random()* 1000000),
        rand = n + '-' + k + '-' + time;
      return rand;
    },
    toHtml: function() {
      generate._html = '<div id="page-blocks" class="show-grid">';
      generate.toJson();
      generate._html += '</div>';
      return generate._html;
    },
    toJson: function() {
      var element = $('#' + generate._elementId);
      var identifier = element.data('identifier');
      identifier = identifier ? identifier : generate.rand();
      generate._json = {
        "@attributes":{
          "identifier": identifier,
          "title": $('#template-title').val()
        },
        row: generate._getRows(element)
      }
      return generate._json;
    },
    _getRows: function(element) {
      var elRows = element.children('.row');
      var rows = [];
      elRows.each(function() {
        generate._html += '<div class="row">';
        var elRow = $(this);
        rows.push({
          col: generate._getCols(elRow)
        });
        generate._html += '</div>';
      })

      return rows;
    },
    _getCols: function(elRow) {
      var elCols = elRow.children('.column');
      var cols = [];
      elCols.each(function() {
        var elCol = $(this),
          grid = elCol.data('template-grid'),
          col = {
            "@attributes": {
              "grid": grid
            }
          },
          colBlock = elCol.find('> .template-editable-region');

        generate._html += '<div class="block-to-connect-edit col-md-' + grid + ' block " data-template-grid="' + grid + '">';
        if (colBlock.length) {
          col['block'] = generate._getBlock(colBlock);
        }else{
          col['row'] = generate._getRows(elCol);
        }
        generate._html += '</div>';
        cols.push(col);
      });

      return cols;
    },
    _getBlock: function(colBlock) {
      var blockIdentifier = colBlock.data('template-identifier'),
        blockTitle = colBlock.find('.template-block-title').html();

      blockIdentifier = blockIdentifier ? blockIdentifier : generate.rand();

      generate._html += '<div class="template-block-content">';
      generate._html += '  <a href="javascript:void(0)">';
      generate._html += '    <div class="wrapper text-center">';
      generate._html += '      <h5>' + blockTitle + '</h5>';
      generate._html += '    </div>';
      generate._html += '  </a>';
      generate._html += '</div>';

      return {
        "@attributes":{
          "identifier": blockIdentifier,
          "title": blockTitle
        }
      };
    }
  }

  var updatePreview = function () {
    $('#templateSkeleton').val(JSON.stringify(generate.toJson()));
    $('#template-render-preview').html(generate.toHtml());
  }
  updatePreview();

  /* End Generate */
});

$(document).ready(function() {
    $('#error-response').html("");
    var token = $('meta[name="csrf-token"]').attr('content');
    var setTemplate = function(templateId) {
            templateId = 'template_' + templateId;
            $('.template-new-schema').addClass("hide");
            $('#' + templateId).removeClass("hide");
        }
        //Template connect
    var selectedTemplate = $('#templatesList').find(":selected:not([disabled])");
    if (selectedTemplate.length) {
        setTemplate(selectedTemplate.val());
    }
    $("#templatesList").change(function() {
        setTemplate(this.value);
        unsetAllConnectedBlocks();
    });
    // Template preview
    var setPreviewTemplate = function(templateId) {
        templateId = 'template_preview_' + templateId;
        $('.template-preview-schema').addClass("hide");
        $('#' + templateId).removeClass("hide");
    }
    var selectedPreviewTemplate = $('#template_id').find(":selected:not([disabled])");
    if (selectedPreviewTemplate.length) {
        setPreviewTemplate(selectedPreviewTemplate.val());
    }
    $("#template_id").change(function() {
        setPreviewTemplate(this.value);
    });
    //ThemePartials
    var switchThemePartial = function($this, type) {
        var url = $this.data('url');
        $.ajax({
            url: url,
            type: type,
            data: {
                _token: token
            }
        });
    }
    $('.themepartial-input').on('ifChecked', function() {
        switchThemePartial($(this), 'POST');
    });
    $('.themepartial-input').on('ifUnchecked', function() {
        switchThemePartial($(this), 'DELETE');
    });
    var randomColor = function() {
        var letters = '0123456789ABCDEF'.split('');
        var c = '#'
        for (var i = 0; i < 6; i++) {
            c += letters[Math.floor(Math.random() * 16)];
        }
        return c;
        //return '#'+Math.floor(Math.random()*16777215).toString(16);
    }
    var connectedBlocks = [];
    var usedNumbers = [];
    var connectionId = 1;
    var connectedBlockFrom, connectedBlockTo, color;
    var alreadyConnected = function(type, identifier) {
        var ret = false;
        $.each(connectedBlocks, function(key, val) {
            if (val && val[type] == identifier) {
                ret = true;
                return;
            }
        });
        return ret;
    }
    var syncConnectBlock = function(type, $block) {
        if (type == 'from') {
            color = randomColor();
            if (connectedBlockFrom) {
                if (connectedBlockFrom == $block.data('template-identifier')) {
                    unsetConnectBlock('from', $block);
                }
            } else if (alreadyConnected('from', $block.data('template-identifier'))) {
                unsetConnectBlock('from', $block);
            } else {
                setConnectBlock('from', $block);
            }
        } else {
            if (connectedBlockFrom) {
                setConnectBlock('to', $block);
            } else if (connectedBlockTo || alreadyConnected('to', $block.data('template-identifier'))) {
                unsetConnectBlock('to', $block);
            }
        }
    }
    var setConnectBlock = function(type, $block) {
        var connectedId = getConnectionId();
        if (type == 'from') {
            connectedBlockFrom = $block.data('template-identifier');
            $block.find('.wrapper h5').prepend('<span class="connected-block" data-connected="' + connectedBlockFrom + '" style="background-color:' + color + '">' + connectedId + '</span> ');
        } else {
            connectedBlockTo = $block.data('template-identifier');
            if (connectedBlockFrom) {
                $block.find('.wrapper h5').prepend('<span class="connected-block" data-connected-from="' + connectedBlockFrom + '" style="background-color:' + color + '">' + connectedId + '</span> ');
                incConnectionId();
                connectedBlocks.push({
                    from: connectedBlockFrom,
                    to: connectedBlockTo,
                    id: connectedId
                });
                connectedBlockFrom = null;
                connectedBlockTo = null;
            }
        }
    }
    var unsetConnectBlock = function(type, $block) {
        var connectedTo, connectedFrom, connectedId;
        $.each(connectedBlocks, function(key, val) {
            if (val && val[type] == $block.data('template-identifier')) {
                connectedFrom = val['from'];
                connectedTo = val['to'];
                connectedId = val['id'];
                connectedBlocks.splice(key, 1);
                decConnectionId(connectedId);
            }
        });
        $block.find('.connected-block').last().remove();
        if (type == 'from') {
            $('[data-connected-from="' + connectedFrom + '"]').remove();
            connectedBlockFrom = null;
        } else {
            if (connectedFrom) {
                $('[data-connected="' + connectedFrom + '"]').remove();
            }
            connectedBlockTo = null;
        }
    }
    var getConnectionId = function() {
        while (existsConnectionId()) {
            connectionId++;
        }
        return connectionId;
    }
    var existsConnectionId = function() {
        var ret = false;
        $.each(usedNumbers, function(key, val) {
            if (val == connectionId) {
                ret = true;
                return;
            }
        });
        return ret;
    }
    var incConnectionId = function() {
        usedNumbers.push(connectionId);
    }
    var decConnectionId = function(delConnectionId) {
        $.each(usedNumbers, function(key, val) {
            if (val == delConnectionId) {
                usedNumbers.splice(key, 1);
            }
        });
        connectionId = 1;
    }
    var unsetAllConnectedBlocks = function() {
        connectedBlocks = [];
        connectedBlockFrom = null;
        connectedBlockTo = null;
        color = randomColor();
        usedNumbers = [];
        connectionId = 1;
        $('.connected-block').remove();
    }
    $('.must-connect').on('click', function() {
        syncConnectBlock('from', $(this))
    });
    $('.block-to-connect-new').on('click', function() {
        syncConnectBlock('to', $(this))
    });
    var isRedBlocksAreConnected = function() {
        var $tpl = $('.must-connect'),
            ret = true;
        if ($tpl.length) {
            $tpl.each(function() {
                var identifier = $(this).data('template-identifier');
                if (!alreadyConnected('from', identifier)) {
                    ret = false;
                    return;
                }
            });
        }
        return ret;
    }
    var showError = function(message) {
        var html = Mustache.to_html($("#errorMessageTemplate").html(), {
            message: message
        });
        $('#error-response').html(html);
    }
    $('#confirmSwitchTemplateAction #confirm').on('click', function() {
        $('#error-response').html("");
        var $this = $(this),
            selectedTpl = $('#templatesList').find(":selected:not([disabled])");
        if (selectedTpl.length != 1) {
            showError($this.data('missing-template'));
            return;
        }
        var templateId = selectedTpl.data('id');
        var url = $this.data('url');
        if (!isRedBlocksAreConnected()) {
            showError($this.data('missing-blocks'));
            return;
        }
        $.ajax({
            url: url,
            type: 'PUT',
            data: {
                _token: token,
                template_id: templateId,
                connected_blocks: JSON.stringify(connectedBlocks)
            }
        }).done(function(response) {
            if (!response.connectedBlocks) {
                showError($this.data('missing-blocks'));
            } else if (!response.template) {
                showError($this.data('missing-template'));
            } else {
                window.location.replace(response.url);
            }
        });
    });
    // Homepage
    $('.homepage-switch').on('ifChecked', function(event) {
        var url = $(this).data('url');
        $.ajax({
            method: "PUT",
            url: url,
            dataType: 'JSON',
            data: {
                _token: token,
            }
        });
    });
});

